import React, { Component } from 'react';
import './Main.css';
import Axios from 'axios';
import Navbar from '../../components/Navbar/Navbar';
import MyStock from '../../components/MyStock/MyStock';
import HorizontalLine from '../../components/HorizontalLine/HorizontalLine';


class Main extends Component {
    constructor(props){
        super(props);
    }
    state = {
        myStocks: {},
        allStocks: {}
    }

    componentDidMount() {
        Axios.get('https://financial-portfolio-trac-178fd.firebaseio.com/allStocks')
            .then(response => {
                console.log(response);
                let allStocks = response.data;
                    Axios.get('https://financial-portfolio-trac-178fd.firebaseio.com/myStocks')
                    .then(response => {
                        console.log(response);
                    this.setState({
                        myStocks: response.data,
                        allStocks: allStocks
                    })
                })

            })
            .catch(error => {console.log(error)});
    }


    render() {

        return (
            <div>

               <Navbar title="Finance Portfolio Tracker" />
               <MyStock />
               <HorizontalLine />

            </div>
        )
    }
}



export default Main;
